(function (namespace) {
  namespace.fonts = namespace.fonts || {}
  const fonts = namespace.fonts

  // DAXPLORE FONT HELPERS
  // Base64 representations of fonts that can be coded into svg.
  // This is needed when saving svg:s as images using the serialize/blob/image.src method,
  // as links to font files won't be used in the serialized svg.

  // SVG FONT HELPERS
  /* varta-regular, varta-bold - latin */
  fonts.getVartaBase64Definition = function () {
    return `
      @font-face {
        font-display: swap;
        font-family: 'VartaBase64';
        font-style: normal;
        font-weight: 400; 
        src: url('data:font/woff2;base64,');
      }
      @font-face {
        font-display: swap;
        font-family: 'VartaBase64';
        font-style: bold;
        font-weight: 700;
        src: url('data:font/ttf;base64,');
      }
    `
  }
})(window.dax = window.dax || {})
